import React from 'react';
import logo from './logo.png';
import './App.css';
// import Parallax from "./components/Parallax/Parallax.js";
import Button from 'react-bootstrap/Button';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import "bootstrap/dist/css/bootstrap.min.css";


function App() {
  return (
    <div className="App">
      <Navbar bg="clear" variant="light" sticky="top">
    <Navbar.Brand href="#home" className="Navbar-brand">Scova. Foundation</Navbar.Brand>
    <Nav className="mr-auto">
      <Nav.Link href="#features">Book</Nav.Link>
      <Nav.Link href="#pricing">Blog</Nav.Link>
    </Nav> 
    <Form inline>
      <FormControl type="text" placeholder="Search Scova" className="mr-sm-2" style={{textAlign:"center"}}/>
      <Button variant="outline-info">Search</Button>
    </Form>
  </Navbar>
      {/* <header className="App-header">
      <a class="active" href="#home">Scova Foundation</a>
      <a href="#news"><Button>Scova</Button></a>
      <a href="#news"><Button>Anhad</Button></a>

      </header> */}
      {/* <Parallax filter image={require("./logo.png")}> */}
      <div className="App"><img src={logo} className="App-logo" alt="logo" /></div>
      {/* </Parallax> */}
    </div>
  );
}

export default App;
